import React, {useCallback, useRef, useState, useEffect} from "react";
import {convertImageToCanvas} from "../util/Util";
import Webcam from "react-webcam";
// import * as mobilenet from '@tensorflow-models/mobilenet';

const AddCompetitor =({net,classifier, webcam})=>{
    console.log(net,classifier)
    const [imageURL, setImageURL] = useState("");
    const [image, setImage] = useState(null);

    const tf = require('@tensorflow/tfjs');
    const classes = ["Untrained", "Carla", "Nelson" , "Dino", "OK","Rock"]

    const webcamRef = useRef(null);
    const refContainer = useRef(null);

    async function addExample (classId) {
        const imgCaptured = await webcamRef.current.getScreenshot();
        // const imgCaptured="data:image/jpeg;base64,"
        try{
        console.log("Training")
        const img = await webcam.capture();
        const activation = net.infer(img, true);
        classifier.addExample(activation, classId);
        //liberamos el tensor
            img.dispose()
            await tf.nextFrame();
        }catch (e) {
            console.log(e)
        }
        console.log("endTraing")
        capture(imgCaptured)
    }

    let imageCamera1;

    const capture = (imageSrc) => {
        console.log("captureingImg")
        const container = refContainer.current;
        imageCamera1 = imageSrc;
        const img = document.getElementById("lastImageCaptured");
        img.setAttribute('src', imageSrc);
    };

    const videoConstraints = {
        width: 1280,
        height: 720,
        facingMode: "user"
    };


return <>
    <button id="btnUntrained" onClick={()=>addExample(1)}>Untrained</button>
    <button id="btnNelson" onClick={()=>addExample(2)}>Nelson</button>
    <Webcam
        id="webcam"
        audio={false}
        height={200}
        ref={webcamRef}
        screenshotFormat="image/jpeg"
        width={400}
        videoConstraints={videoConstraints}
    />
    <br />Last Image Captured
    <br />
    <img src="" id="lastImageCaptured" width="400px" height="200px"/>
</>
}

export default AddCompetitor;